import React from 'react';
import {MenuItems} from './menuItems'

function NavBar (){
        return(
            <nav className='navbarItems'>
                <div>
                <img src='' alt='' />
                </div>
                <ul>
                    {MenuItems.map((item, index) => {
                        return (
                        <li key={index}> 
                            <a className={MenuItems.cName} href={item.url}>
                            {item.title}
                            </a>
                        </li>
                        )
                        })}
                </ul>
            </nav>
        );
    }

export default NavBar;
